import { Routes, Route } from "react-router-dom";
import "./App.css";
import StartVideopage from "./pages/StartVideo";
import RoomPage from "./pages/VideoRoom";
import Account from "./pages/Account"; // Account 페이지를 import합니다.
import Login from "./pages/Login";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/account" element={<Account />} /> {/* Account 페이지에 대한 라우트를 추가합니다. */}
        <Route path="/login" element={<Login />} />
        <Route path="/" element={<StartVideopage />} />
        <Route path="/room/:roomId" element={<RoomPage />} />
      </Routes>
    </div>
  );
}

export default App;
